import React, {Component} from "react";

class Sidebar extends Component {
    render() {
        return (
            <div className="navigation__sidebar">
                <img className="sidebar-profile__photo" />
                <div className="sidebar-username">Username</div>
            </div>
        );
    }
}

export default Sidebar;
